import { UserContext } from "../context/user"
import { useState, useContext, useEffect} from 'react'
function Homepage ({setIsLogged}) {

    const {user, setUser} = useContext(UserContext)

    if (user == null)
    {
        fetch('/check').then(r => {
            if (r.ok) {
                return r.json()
            }

        })
        .then(body => {
            setUser(body)
            setIsLogged(true)
        })
    }

    return (
        <h1>Welcome</h1>
    )
}

export default Homepage
